<script>
/**
 * @param {number} n - a positive integer
 * @return {number}
 */
/**
 * @param {number} n
 * @return {number[]}
 */
var printNumbers = function(n) {
    const len = Math.pow(10,n)-1;
    const res = new Array(len);
    for(let i = 0; i <  len; i++) {
        res[i] = 1 + i; 
    }
    return res;
};
</script>
